Please don't delete this listing as the "For Sale" section will reach the most firearm owners.

Below is an email list of the entire Colorado General Assembly, these are the Colorado State Representatives that draft and enact laws for the State of Colorado. Please take a few minutes to compose a short, polite email objecting to any new firearm laws being purposed or enacted in Colorado. Be respectful in your email, we don't want to turn any friends into foes. You can copy and paste the email list below into your emails "TO" or "ADDRESS" field, which will allow you to reach ALL of the state representatives in one simple e-mailing. Feel free to pass this along to anyone who supports our 2nd Admendment freedom that allows us to hunt, target shoot, and protect our homes and loved ones.
 
Also, please watch the short 6 minute youtube video about the source of violent crime in America and how it relates to firearms ownership, it is derived directly from the FBI's most recent crime statistics.
 
http://www.youtube.com/watch?v=FhkSmniM_O4
 
 
